// Input: { html, website, keyword, location }
// Output: { html, website, keyword, location, phone }

const html = String($json.html || '');
const flat = html.replace(/\s+/g, ' ');

// ---------- helpers ----------
const onlyDigits = s => (s || '').replace(/\D/g, '');
const hasSep = s => /[()\s\-\.]/.test(s || ''); // any separator
const balancedParens = s => {
  const opens = (s.match(/\(/g) || []).length;
  const closes = (s.match(/\)/g) || []).length;
  return opens === closes;
};
const lowVariety = s => {
  const d = onlyDigits(s);
  const uniq = new Set(d.split(''));
  return d.length >= 9 && uniq.size <= 2; // e.g., 999999999, 111111111, 90909090
};
const looksLikeImageSize = s => /\d{2,4}x\d{2,4}/i.test(s); // 300x200
const hasDecimal = s => /\d\.\d/.test(s);                    // 144.9703
const tooLongBareRun = s => {
  const d = onlyDigits(s);
  return d.length > 13 || (!s.startsWith('+') && d.length >= 12 && !hasSep(s));
};
function normalize(s) {
  return (s || '').replace(/\s+/g, ' ').trim();
}
function valid(s, isGeneral = false) {
  if (!s) return false;
  if (hasDecimal(s)) return false;
  if (looksLikeImageSize(s)) return false;
  if (!balancedParens(s)) return false;
  if (lowVariety(s)) return false;
  if (tooLongBareRun(s)) return false;

  const d = onlyDigits(s);
  if (d.length < 8 || d.length > 15) return false; // global-ish bounds

  // For general matches, require at least one separator unless it starts with +
  if (isGeneral && !s.startsWith('+') && !hasSep(s)) return false;

  // Reject obvious placeholders
  if (/999[\s\-]?999[\s\-]?9999|000+/.test(d)) return false;

  return true;
}

// ---------- 1) tel: links (best) ----------
const telMatches = [...flat.matchAll(/href=["']tel:([+()\d\-\s\.]+)/gi)]
  .map(m => normalize(m[1]));

// ---------- 2) numbers near "phone/tel/call" ----------
const labeled = [];
const labelRe = /(?:phone|tel|telephone|call)[:\s]*(?:<\/?[^>]*>|\s){0,16}([+()\d\-\s\.]{7,30})/gi;
let lm;
while ((lm = labelRe.exec(flat)) !== null) labeled.push(normalize(lm[1]));

// ---------- 3) general fallback ----------
const generalRaw = flat.match(/(?:\+?\d{1,4}[\s\-\.]?)?(?:\(?\d{2,4}\)?[\s\-\.]?)\d{3,4}[\s\-\.]?\d{3,4}(?:[\s\-\.]?\d{1,4})?/g) || [];
const general = generalRaw.map(normalize).filter(s => valid(s, true));

// ---------- de-dup (priority: tel > labeled > general) ----------
const seen = new Set();
const ordered = [];
for (const arr of [telMatches, labeled, general]) {
  for (const s of arr) {
    if (!valid(s, arr === general)) continue;
    const key = onlyDigits(s);
    if (seen.has(key)) continue;
    seen.add(key);
    ordered.push(s);
  }
}

let phone = ordered[0] || 'No phone listed';

// Force Sheets to treat phone as text (avoid "+1-800..." becoming math)
if (phone !== 'No phone listed' && phone.startsWith('+')) {
  phone = `'` + phone;
}

return [{ json: { ...$json, phone } }];

