// Input: { html, website, keyword, location, phone }
// Output: exactly ONE row per website (emails aggregated)

// --- read + normalize ---
let html = String($json.html ?? $json ?? "");

// decode simple obfuscations and entities
html = html
  // zero-width chars
  .replace(/[\u200B-\u200D\u2060\uFEFF]/g, "")
  // [at]/(at)/ " at "
  .replace(/\s*\[at\]\s*|\s*\(at\)\s*|\s+at\s+/gi, "@")
  // [dot]/(dot)/ " dot "
  .replace(/\s*\[dot\]\s*|\s*\(dot\)\s*|\s+dot\s+/gi, ".")
  // HTML entities for @ and .
  .replace(/&#x40;|&#64;|&commat;/gi, "@")
  .replace(/&#46;|&period;/gi, ".")
  // spacing around @ and .
  .replace(/\s+@\s+/g, "@")
  .replace(/\s+\.\s+/g, ".");

// --- collect candidates ---
const mailtos = (html.match(/mailto:([a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,24})/gi) || [])
  .map(m => m.replace(/^mailto:/i, ""));
const plain = (html.match(/[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,24}/gi) || []);
let emails = Array.from(new Set([...mailtos, ...plain].map(e => e.toLowerCase().trim())))
  .map(e => e.replace(/[),;:'"]+$/g, "")); // trim trailing punctuation

// --- validators/filters (roles allowed) ---
const strict = /^[a-z0-9](?:[a-z0-9._%+-]{0,62}[a-z0-9])@(?:[a-z0-9-]+\.)+[a-z]{2,24}$/i;
const assetTLD = new Set([
  "png","jpg","jpeg","gif","svg","webp","ico","bmp","apng","avif",
  "pdf","css","js","map","woff","woff2","ttf","otf","mp4","webm","mov","mkv","heic","heif"
]);
const denyTrackerDomains = /(ingest\.sentry\.io|\.sentry\.io|cloudflare\.com|cloudfront\.net|googlemail\.com|w3\.org)$/i;
const denyPlaceholderDomains = /(domain\.com|example\.(com|org|net)|yourdomain\.com|email\.com|test\.com|localhost|invalid)$/i;
const denyPlaceholderPairs   = /^(user|username|name|yourname|firstname|lastname|test|demo)@(domain\.com|example\.com|yourdomain\.com|test\.com|email\.com)$/i;
// tokens like @2x or -300x200 in the domain
const sizeTokenInDomain = /(@\d+(?:\.\d+)?x)|(?:^|[.\-])\d+(?:\.\d+)?x\d+(?:\.\d+)?(?:[.\-]|$)/i;
// reject “hashy” locals like 5f12ad6e7261...
const isHashyLocal = (local) => /^[a-f0-9]{20,}$/.test(local);

// filter sequence
emails = emails
  .filter(e => strict.test(e))
  .filter(e => {
    const dom = (e.split("@")[1] || "");
    const tld = (dom.split(".").pop() || "").toLowerCase();
    return !assetTLD.has(tld);
  })
  .filter(e => !denyTrackerDomains.test((e.split("@")[1] || "")))
  .filter(e => {
    const [local, dom] = e.split("@");
    return !denyPlaceholderDomains.test(dom || "") && !denyPlaceholderPairs.test(e) && !isHashyLocal(local || "");
  })
  .filter(e => !sizeTokenInDomain.test(e.split("@")[1] || ""));

// --- attach meta ---
const website  = $json.website  || ($item(0).$node["Loop Over Items"].json.website || "");
const keyword  = $json.keyword  || ($node["Get Form Data"].json?.Keyword  ?? "");
const location = $json.location || ($node["Get Form Data"].json?.Location ?? "");
const phoneRaw = $json.phone || '';
const phone    = phoneRaw || 'No phone listed';

// --- aggregate to ONE row per website ---
const uniq = Array.from(new Set(emails));
let emailCell = "";

if (uniq.length > 0) {
  emailCell = uniq.join(", ");
} else if (phoneRaw && phoneRaw !== 'No phone listed') {
  // leading apostrophe forces literal text in Sheets (prevents formula parsing)
  emailCell = `'Phone only: ${phoneRaw} — please double-check on the website before calling, or use the contact form`;
} else {
  emailCell = `'No email — use the website contact form`;
}

return [{
  json: {
    email: emailCell,
    website,
    keyword,
    location,
    phone
  }
}];
